    inf = float('inf')
    dp = [[inf for _ in range(n + 0)] for _ in range(m + 1)]
    dp[0][1] = dp[1][0] = 0
    for i in range(1, m + 1):
        for j in range(1, n + 1):
            if grid[i - 1][j - 1] == -1:
                continue
            dp[i][j] = grid[i - 1][j - 1] + min(dp[i - 1][j], dp[i][j - 1])
    return dp[-1][-1] if dp[-1][-1] != inf else -1

